import{_ as e}from"./plugin-vue_export-helper-c27b6911.js";import{o as i,c as t,f as a}from"./app-ef3ee2ee.js";const o={},s=a('<h2 id="home-page" tabindex="-1"><a class="header-anchor" href="#home-page" aria-hidden="true">#</a> Home Page</h2><p>The dashboard comprise 4 pages, the Home page, Super Structure, Spec BREAKDOWN and Appendix C.</p><p>This is the Home page, which consists of several redirect buttons. These buttons facilitate navigation to the corresponding pages.</p><p>The following slides will show the details of each page.</p><h2 id="spec-breakdown-page" tabindex="-1"><a class="header-anchor" href="#spec-breakdown-page" aria-hidden="true">#</a> SPEC BREAKDOWN Page</h2><p>The page is the SPEC BREAKDOWN page, which integrate the LOD Specification dataset, to supply a tool to query and analyze the specification easily.</p><p>This page structured with the four key parts,</p><ol><li>The specification filter to help to filter specifications data base on Code, Name and Level.</li><li>The Specification LOD Proportion will show an overview of the different levels and proportions of all specification data.</li><li>Specification Description Word Could is based on the specification Description, the description contains the main content to define the LOD. Which will help to find the most important attributes correspond to LOD.</li><li>Specification List is the main part for listing the specification records.</li></ol><h2 id="super-structure" tabindex="-1"><a class="header-anchor" href="#super-structure" aria-hidden="true">#</a> Super Structure</h2><p>This page the super structure, which integrate the BIM data and specifications data. This page is using a set of rules to find the relationship between BIM data and specifications， which will help client in performing manual LOD checks more efficiently.</p><p>This page structured with the 7 key parts,</p><ol><li>BIM Element Filter aims to filter BIM data based on GUID, Category and Name.</li><li>Specification FIlter is used for filtering Specification data based on Code, Name and Level.</li><li>BIM Element Count show the BIM Data Count.</li><li>Specification Records Count shows the specification count.</li><li>Specification Description Word Cloud is the same with the previous page.</li><li>BIM Data List shows all BIM dataset.</li><li>Specification List shows LOD Specification dataset.</li></ol><h2 id="appendix-c" tabindex="-1"><a class="header-anchor" href="#appendix-c" aria-hidden="true">#</a> Appendix C</h2><p>Appendix C page shows Rules-based Engine Result, which indicates whether the BIM data complies with LOD 300. The rules are provided by the client.</p><p>This page structured with the 7 key parts,</p><ol><li>BIM Data Count shows the count the BIM dataset.</li><li>BIM Data Filter keep the same with the previous page.</li><li>The BIM Count Grouped by Class shows the data amount for each class.</li><li>The proportion LOD 300 Compliance Grouped by Class shows the proportion of rule-based result for each class.</li><li>The overall proportion of LOD 300 Compliance shows the overview proportion of the rule-based result.</li><li>The Attributes List that Causes Non-Compliant to LOD 300 shwos the attributes list that cause the non-compliance.</li><li>BIM Data List shows the BIM dataset.</li></ol><h2 id="data-issues-and-limitations" tabindex="-1"><a class="header-anchor" href="#data-issues-and-limitations" aria-hidden="true">#</a> Data Issues and Limitations</h2><ol><li>Missing data:<br> Incomplete attributes:<br> Inconsistent codes:</li><li>Software-specific Elements:<br> Irrelevant data requiring cleanup:</li><li>Lack of Standardization<br> Non-standard naming complicates automation.</li><li>High Volumn and Complexity:<br> Numerous components and attributes make automation difficult.</li></ol><p>For these issues, we recommend using standard name and data entry practices while modeling any project.</p><h2 id="learning-outcomes" tabindex="-1"><a class="header-anchor" href="#learning-outcomes" aria-hidden="true">#</a> LEARNING OUTCOMES</h2><h2 id="personal-learning" tabindex="-1"><a class="header-anchor" href="#personal-learning" aria-hidden="true">#</a> Personal Learning</h2><ul><li><p>Collaboration is more effective than working alone.​</p><ul><li>Leveraging the diverse skills and perspectives of the team to achieve better results and foster innovation.</li></ul></li><li><p>Leverage the strengths of each team member</p><ul><li>Leverage the strengths of each team member to achieve collective goals with greater efficiency and effectiveness..​</li></ul></li><li><p>Continuous work</p><ul><li>With continuous dedication and unremitting efforts, all problems will be solved, paving the way for success and growth.</li></ul></li></ul>',22),n=[s];function r(l,h){return i(),t("div",null,n)}const d=e(o,[["render",r],["__file","FinalReportPresentation.html.vue"]]);export{d as default};
